🚨
**Canned 9/2**
🚨
🚨
🚨
Look: pours a hazy, thick and murky honey yellow. This puppy looks pulpy and thicc, with zero light penetration. Very minimal in terms of head and lacing, but color alone is fantastic. 
🚨
Smell: citrus bomb. Orange and grapefruit dominate the aroma profile. There is a distinct yeasty note as well. I also pick up on strawberry, bubblegum, and green tea with a faint Galaxy-foreword grassy background. 
🚨
Taste: flavor is great, representing the perfect marriage between Galaxy and citra. Galaxy is very prominent on the flavor, lending its grassy, lemony, white wine and semi-dank attributes. The Citra picks up midway through, comprised (as you’d expect) mostly of citrus, such as orange and tangerine. Grapefruit, mango, lemon and Passionfruit at the finish. The finish is slightly grassy, dry and effervescent, with the aftertaste being biscuity from the yeast with hints of citrus, bubblegum and black pepper. 
🚨
Feel: incredible. Medium in body but heavier in weight. It’s soft, creamy, pillowy and loft. Booze is totally hidden; the carbonation is on the lower end of moderate, which is to my preference. 
🚨
Overall: it’s really solid. I don’t believe I have Trillium’s version of Vicinity, but I can say with confidence that Monk has done it justice. While I will admit, it is a tad “green,” is it still tasting gloriosi right out of the gate. For me, my favorite part is the mouthfeel. It’s exactly what I look/hope for in beers in this style. 
🚨
My Rating: 4.3/5.0
🚨
Glass: Monkillium by @monkishbrewing 
